import React, { useEffect, useState } from 'react';
import axios from 'axios';

const RecipientManagement = () => {
  const [recipients, setRecipients] = useState([]);

  useEffect(() => {
    axios.get('/api/recipients')
      .then(response => {
        setRecipients(response.data);
      })
      .catch(error => {
        console.error("There was an error fetching the recipients!", error);
      });
  }, []);

  return (
    <div>
      <h2>Recipient Management</h2>
      <table>
        <thead>
          <tr>
            <th>ID</th>
            <th>User Name</th>
            <th>Donation Description</th>
            <th>Quantity Received</th>
            <th>Actions</th>
          </tr>
        </thead>
        <tbody>
          {recipients.map(recipient => (
            <tr key={recipient.id}>
              <td>{recipient.id}</td>
              <td>{recipient.userName}</td>
              <td>{recipient.donationDescription}</td>
              <td>{recipient.quantityReceived}</td>
              <td>
                <button>Edit</button>
                <button>Delete</button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default RecipientManagement;
